@alfmunone Donde me has leido posicionarme?

Se puede estar agradecido a Agustin y creer que el dinero de Felipe es necesario?

Metes al resto de mis companeros por uno tweet mio sin saber su opinion y cuando solo he dado mi opinion de todo lo que pasa.

@saezalvaro Viendo lo que han dicho uno y otro, esto es un plebiscito entre Agustin o Felipe. 

Mi sensacion es que Felipe ha querido ganarse al pequeno accionista que puede sumar mucho y Agustin tiene gente detras con mucho %.

Muy dificil explicar un NO a 10M tal y como estamos.
